	constructor(props){
		super(props);

		this.state = {
			vaccines: VACCINES
		};

	mapHandler = (event) => {
		alert(event.target.dataset.name);
    };
	}

	render(){
		return (
			<div className='App'>
				<Navbar color="primary">
					<div className="container" id="brand">
						<NavbarBrand>Vaccination Dashboard</NavbarBrand>
					</div>
				</Navbar>
				<CurrentLocation />





				<h1>General Information</h1>
				<Menu vaccine={this.state.vaccines} />
			</div>
		);
	}
}

export default App;
